description:
A person shown in water with a ball,&nbsp;playing the sport of water polo.&nbsp;
<em>Person Playing Water Polo</em> was approved as part of <a href="/unicode-9.0/">Unicode 9.0</a> in 2016 under the name “Water Polo” and added to <a href="/emoji-3.0/">Emoji 3.0</a> in 2016.
<span class="emoji">🚩</span> Previously displayed a gendered appearance, now shown as gender neutral on most platforms.

An adhesive bandage used for first aid. Sometimes called a <em>Band-Aid</em> or <em>band aid</em>&nbsp;after the trademarked product. Sometimes called a <em>plaster</em>.<br>
&nbsp;
<em>Adhesive Bandage</em> was approved as part of <a href="/unicode-12.0/">Unicode 12.0</a> in 2019 and added to <a href="/emoji-12.0/">Emoji 12.0</a> in 2019.
